5:"切換開關（TGL）",senior_btn_text1:"Rappy Snappy 監控所選的兩個按鍵，並激活按下較深的按鍵。",senior_btn_text2:"SOCD 監控所選的兩個按鍵，並根據您選擇的設定激活它們。",senior_btn_text3:"單個按鍵實現 4 種功能：您可以根據4種不同的按壓程度綁定 1 至 4 種功能。",senior_btn_text4:"單個按鍵實現 2 種功能：按住按鍵為一種，單擊按鍵為另一種。",senior_btn_text5:"單擊按鍵可切換開啟或關閉持續觸發。按住按鍵則為正常觸發行為。",key_btn1:"按鍵1",key_btn2:"按鍵2",key_btn3:"按住",key_btn4:"單擊",senior_mask1:"Rappy Snappy 監控所選的兩個按鍵，並激活按下較深的按鍵。",senior_mask2:"SOCD 監控所選的兩個按鍵，並根據您選擇的設定激活它們。",senior_mask3:"",senior_mask4:"單個按鍵實現 2 種功能：按住按鍵為一種，單擊按鍵為另一種。",senior_mask5:"單擊按鍵可切換開啟或關閉持續觸發。按住按鍵則為正常觸發行為。",task_key_name1:"清空",task_key_name2:"刪除",task_key_name3:"向上移動",task_key_name4:"向下移動",key_type_name1:"按下",key_type_name2:"鬆開",key_string_message:"請選擇按鍵!",calibration_title:"行程校準",calibration_text:"請將需要校準的按鍵完全按下，當按鍵顯示綠色時說明校準成功.",calibration_close:"保存校準",mt_title:"按住時間",mt_reset:"重置為預設設定",mt_mask_title:"手動調整按住時間",mt_mask_defa:'手動調整觸發"按住"鍵所需的時間（默認為400毫秒）。',mt_mask_tips:"提示：如果“按住”綁定的是修飾鍵與另一個鍵的組合，那麼按住會立即觸發。除非另一個鍵也是雙效點擊鍵。",mt_icon1:"按住",mt_icon2:"單擊",mask_tips1:"RS監控2個選定的鍵，並激活按下的鍵。例如，當A鍵被按下時，如果D鍵比A鍵按得更深，則D鍵會立即激活。一旦您釋放了D鍵，A鍵就會激活。",mask_tips2:"SOCD指的是一種技術，用於處理同時按下對立方向鍵時的輸入。具體來說，當玩家在操作設備時，如果同時按下兩個方向鍵（如上和下，左和右），SOCD技術會根據設定的規則或算法來決定如何處理這些輸入，以避免衝突或錯誤。",mask_tips3:"單個按鍵實現 4 種功能：您可以根據 4 種不同的按壓程度綁定 1 至 4 種功能。拖放按鍵到您想要的鍵位上即可綁定動態鍵程鍵。<br><br>您可以選擇兩種方式：點擊 “+“ 圖案實現單次觸發（只觸發一次），或是拖動黃點跨過數個 ”+“ 圖案複現正常的按鍵觸發行為。如果您要重複某個動作，只需回到原本鍵程位置即可繼續，不需要完成整個鍵程設置。<br><br>小技巧：利用此功能，您可以用一個按鍵同時做出 2 種移動方式：在基本移動鍵（通常是 WASD）的第二個功能格子裡綁定遊戲中的衝刺鍵（通常是 Shift），然後拖動黃點跨過第二個（按壓觸底）和第三個（按壓觸底時抬起）“+”形成黃線，如此即可在基本移動的基礎上同時移動與衝刺。",mask_tips4:"單個按鍵實現 2 種功能：按住按鍵為一種，單擊按鍵為另一種。拖放按鍵到您想要的鍵位上即可綁定雙效點擊鍵。<br><br>如果“按住”綁定的是修飾鍵與另一個鍵的組合的話，按住會立即觸發。除非另一個鍵也是雙效點擊鍵。<br><br>小技巧：可以將您鍵盤右下的四個修飾鍵改為 MT 鍵，這樣按住時可以是原本修飾鍵的功能，單擊的時候則是方向鍵。",mask_tips5:"單擊按鍵可切換開啟或關閉持續觸發。按住按鍵則為正常觸發行為。拖放按鍵到您想要的鍵位上即可綁定切換開關鍵。<br><br>單擊按鍵相當於鎖定按鍵於觸發位置。按住後放開按鍵則為原本正常的按鍵輸入。<br><br>提示：遊戲中蹲下鍵（通常是 C 鍵）可使用此功能。該綁定鍵就能同時實現蹲下（按住）以及蹲下（切換）。",mask_btn:"明白了",colourful:"多彩",dks_mask_tips1:"重置為全局",dks_mask_tips2:"按鍵起點",dks_mask_tips3:"完成抬起",dks_mask_text:"設定第一個和最後一個DKS動作的觸發點。",m